import { React } from 'react';
import { Link } from 'react-router-dom'
import '../Styles/Navbar.css';

function Dropdown() {
    return (
        <div className="dropdown">
            <Link to="/" id="homeButton"><button>Home</button></Link>
            <button class="reg-button">Graph</button>
            <button class="reg-button">Predict</button>
        </div>
    )
}

export default Dropdown;
